import React from 'react'
import FooterStyle from '../css/Footer.css'
import {Container} from 'react-bootstrap'

function Footer() {
	return (
		<Container>
		<p className="footer">Developed by Edward Linton</p>
		</Container>
	)
}

export default Footer
